public class Solution {
    public int MinSizeSubarray(int[] nums, int target) {
        int n = nums.Length;
        long totalSum = 0;
        foreach (int num in nums) {
            totalSum += num;
        }

        if (totalSum == target) return n;
        if (totalSum < target) return -1;

        long currentSum = 0;
        int minLength = int.MaxValue;
        int start = 0;

        for (int i = 0; i < n * 2; i++) {
            currentSum += nums[i % n];

            while (currentSum - (start <= i ? nums[start % n] : 0) >= target) {
                if (currentSum >= target) {
                    minLength = Math.Min(minLength, i - start + 1);
                }
                currentSum -= nums[start % n];
                start++;
            }
        }

        return minLength == int.MaxValue ? -1 : minLength;
    }
}
